<script nonce="JbCw6q/x+kB41cEbyvrvQw==" >var rodoConsentModalProps = {"triggerEnabled":false,"acceptButtonLabel":"przejdz dalej","closeButtonEnabled":true,"rejectButtonLabel":"nie zgadzam sie","modalTitle":"Droga Klientko\u002FDrogi Kliencie,","content":"\u003Cdiv data-box-name=\"rodo consent modal text\" data-prototype-id=\"allegro.richText\" data-prototype-version=\"1.0\" data-skin-class-name=\"\" data-analytics-enabled data-analytics-category=\"allegro.richText\" data-analytics-tags=\"\" data-analytics-groups=\"%5B%22allegro.footer%22%5D\"\u003E\u003Ca name=\"rodo-consent-modal-text\"\u003E\u003C\u002Fa\u003E\u003Cdiv class=\" _5c3c4_3IOoH rich-text  \"\u003E\u003Ch5 class=\"_1f21n _1sjrk\"\u003EMozemy lepiej dopasowac tresci reklamowe do Twoich potrzeb. Potrzebujemy na to Twojej zgody.\u003C\u002Fh5\u003E\n\u003Cp class=\"_r5ckd _5c3c4_26Dnf\"\u003EJezeli klikniesz przycisk ,,Przejdz dalej" lub zamkniesz to okno, to wyrazisz zgode na przetwarzanie przez Allegro.pl sp. z o.o. (Allegro.pl) i jej Zaufanych Partnerow Twoich danych osobowych zapisywanych w plikach cookies lub za pomoca podobnej technologii w celach marketingowych (w tym poprzez profilowanie i analizowanie) podmiotow innych niz Allegro.pl, obejmujacych w szczegolnosci wyswietlanie spersonalizowanych reklam na platformie handlowej Allegro.pl.\u003C\u002Fp\u003E\n\u003Cp class=\"_r5ckd _5c3c4_26Dnf\"\u003EAdministratorami Twoich danych bedzie Allegro.pl, jak rowniez nasi Zaufani Partnerzy, z ktorymi stale wspolpracujemy.\u003C\u002Fp\u003E\n\u003Cp class=\"_r5ckd _5c3c4_26Dnf\"\u003EWyrazenie zgody jest dobrowolne. Zgode mozesz w kazdym momencie wycofac lub ponownie wyrazic na stronie&nbsp;\u003Ca href=\"\u002Fregulaminy\u002Fdopasowanie-reklam-mGEVAZaXoc3#ukryj-modal-rodo\" name role target=\"_blank\" class=\"_sm3us\" rel=\"follow,noopener\" data-analytics-clickable\u003EDopasowanie reklam\u003C\u002Fa\u003E. Pamietaj, ze wycofanie zgody nie wplywa na zgodnosc z prawem przetwarzania dokonanego wczesniej.\u003C\u002Fp\u003E\n\u003Cp class=\"_r5ckd _5c3c4_26Dnf\"\u003EDzieki Twojej zgodzie, bedziemy mogli wyswietlac Ci reklamy produktow dopasowane do Twoich potrzeb.\u003C\u002Fp\u003E\n\u003Cp class=\"_r5ckd _5c3c4_26Dnf\"\u003EInformujemy takze, ze korzystajac z platformy handlowej Allegro.pl, wyrazasz zgode na przechowywanie w Twoim urzadzeniu koncowym (o ile pozwala na to konfiguracja Twojej przegladarki) plikow cookies lub stosowanie innych podobnych technologii oraz na wykorzystywanie ich do dopasowywania tresci marketingowych i reklam. Jezeli nie zmienisz ustawien Twojej przegladarki, cookies beda zapisywane w pamieci Twojego urzadzenia. Wiecej w&nbsp;\u003Ca href=\"\u002Fregulaminy\u002Fpolityka-plikow-cookies-lDzYv9wn8Tn#ukryj-modal-rodo\" name role target=\"_blank\" class=\"_sm3us\" rel=\"follow,noopener\" data-analytics-clickable\u003EPolityce plikow cookies\u003C\u002Fa\u003E.\u003C\u002Fp\u003E\n\u003Cp class=\"_r5ckd _5c3c4_26Dnf\"\u003EPod tym adresem znajdziesz pelna liste&nbsp;\u003Ca href=\"\u002Fregulaminy\u002Fzaufani-partnerzy-oGWwBnzAGFE#ukryj-modal-rodo\" name role target=\"_blank\" class=\"_sm3us\" rel=\"follow,noopener\" data-analytics-clickable\u003EZaufanych Partnerow\u003C\u002Fa\u003E&nbsp;Allegro.pl. Zaufani Partnerzy moga korzystac ze swoich zaufanych podwykonawcow. Przez Zaufanych Partnerow rozumiemy podmioty, z ktorymi Allegro.pl wspolpracuje w zakresie realizacji dzialan reklamowych, ktore moga w szczegolnosci polegac na:\u003C\u002Fp\u003E\n\u003Cul class=\"_3a4zn\"\u003E\n\u003Cli class=\"_5c3c4_3WWXr\"\u003Eprzechowywaniu i dostepie do informacji : przechowywanie informacji lub dostep do informacji, ktore sa juz przechowywane na Twoim &nbsp;urzadzeniu, takie jak identyfikatory reklamowe, identyfikatory urzadzen, pliki cookie i podobne technologie;\u2028\u003C\u002Fli\u003E\n\u003Cli class=\"_5c3c4_3WWXr\"\u003Epersonalizacji reklam: zbieranie i przetwarzanie informacji na temat Twoich dzialan w celu personalizowania reklam i\u002Flub tresci w na stronach internetowych lub w ramach aplikacji mobilnej; \u2028\u003C\u002Fli\u003E\n\u003Cli class=\"_5c3c4_3WWXr\"\u003Ewyborze reklam, ich dostarczeniu i raportowaniu: zbieranie informacji i laczenie z wczesniej zebranymi informacjami, aby wybrac i dostarczyc reklamy dla Ciebie, oraz zmierzyc ich skutecznosc;\u2028\u003C\u002Fli\u003E\n\u003Cli class=\"_5c3c4_3WWXr\"\u003Ewyborze tresci ich dostarczenie i raportowanie: zbieranie informacji i laczenie z wczesniej zebranymi informacjami w celu wybrania i dostarczenia tresci dla Ciebie, oraz zmierzenie dostarczenia i skutecznosci takich tresci.\u2028\u003C\u002Fli\u003E\n\u003Cli class=\"_5c3c4_3WWXr\"\u003Epomiarze emisji reklam i tresci: gromadzenie informacji na temat korzystania z tresci reklam za posrednictwem roznych narzedzi do pomiaru w celu zrozumienia i raportowania sposobu korzystania z uslugi. \u2028\u003C\u002Fli\u003E\n\u003C\u002Ful\u003E\n\u003Cp class=\"_r5ckd _5c3c4_26Dnf\"\u003EDodatkowe informacje na temat przetwarzania Twoich danych osobowych w tym o przyslugujacych Ci uprawnieniach (prawo dostepu, sprostowania oraz usuniecia Twoich danych, ograniczenia ich przetwarzania, prawo do ich przenoszenia, niepodlegania zautomatyzowanemu podejmowaniu decyzji, w tym profilowaniu, a takze prawo wyrazenia sprzeciwu wobec przetwarzania Twoich danych osobowych) znajdziesz w&nbsp;\u003Ca href=\"\u002Fregulamin\u002Fpl\u002Fzalacznik-5#ukryj-modal-rodo\" name role target=\"_blank\" class=\"_sm3us\" rel=\"follow,noopener\" data-analytics-clickable\u003EPolityce ochrony prywatnosci\u003C\u002Fa\u003E.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E\u003C\u002Fdiv\u003E"};</script>
